import React, { useState } from "react";
import "./CustomerDashboard.css";

const CustomerDashboard = () => {
  const [activeTab, setActiveTab] = useState("submit");
  const [complaintText, setComplaintText] = useState("");
  const [complaintId, setComplaintId] = useState("");
  const [complaintStatus, setComplaintStatus] = useState(null);

  // Mock user data
  const userData = {
    name: "Jane Doe",
    email: "jane@example.com",
    phone: "+9876543210",
  };

  const handleSubmitComplaint = (e) => {
    e.preventDefault();
    alert(`Complaint submitted: ${complaintText}`);
    setComplaintText("");
  };

  const handleTrackComplaint = (e) => {
    e.preventDefault();
    setComplaintStatus(`Complaint #${complaintId} is currently "In Progress"`);
  };

  return (
    <div className="cust-dashboard">
      <h2 className="cust-dashboard-title">Customer Dashboard</h2>

      <div className="cust-tabs">
        <button
          className={activeTab === "submit" ? "cust-tab-active" : ""}
          onClick={() => setActiveTab("submit")}
        >
          Submit Complaint
        </button>
        <button
          className={activeTab === "track" ? "cust-tab-active" : ""}
          onClick={() => setActiveTab("track")}
        >
          Track Complaint
        </button>
        <button
          className={activeTab === "profile" ? "cust-tab-active" : ""}
          onClick={() => setActiveTab("profile")}
        >
          User Profile
        </button>
      </div>

      <div className="cust-tab-content">
        {activeTab === "submit" && (
          <form onSubmit={handleSubmitComplaint} className="cust-submit-form">
            <h3>Submit a Complaint</h3>
            <textarea
              className="cust-submit-textarea"
              placeholder="Enter your complaint here..."
              value={complaintText}
              onChange={(e) => setComplaintText(e.target.value)}
              required
            />
            <button className="cust-submit-btn" type="submit">
              Submit
            </button>
          </form>
        )}

        {activeTab === "track" && (
          <div className="cust-track-container">
            <h3>Track Your Complaint</h3>
            <form onSubmit={handleTrackComplaint} className="cust-track-form">
              <input
                className="cust-track-input"
                type="text"
                placeholder="Enter Complaint ID"
                value={complaintId}
                onChange={(e) => setComplaintId(e.target.value)}
                required
              />
              <button className="cust-track-btn" type="submit">
                Track
              </button>
            </form>
            {complaintStatus && (
              <p className="cust-track-status">{complaintStatus}</p>
            )}
          </div>
        )}

        {activeTab === "profile" && (
          <div className="cust-profile-container">
            <h3>User Profile</h3>
            <p><strong>Name:</strong> {userData.name}</p>
            <p><strong>Email:</strong> {userData.email}</p>
            <p><strong>Phone:</strong> {userData.phone}</p>
          </div>
        )}
      </div>
    </div>
  );
};

export default CustomerDashboard;
